import React from 'react';
import { BrowserRouter as Router, Route, Routes, useLocation } from 'react-router-dom';
import Login from './components/auth/Login';
import PasswordRecovery from './components/PasswordRecovery';
import SignUp from './components/Signup';
import Home from './components/Home';
import Dashboard from './components/Pages/dashboard';
import Meetings from './components/Pages/meetings'; // Ensure this path is correct 
import Settings from './components/Pages/settings';
import Directory from './components/Pages/directory';
import ConditionalSidebar from './components/sidebar/ConditionalSidebar';
import MeetingEdit from './components/Meetings/Agenda/MeetingEdit';

// import Uploads from './Uploads';

const App = () => {
  return (
    <Router>
      <ConditionalSidebar>
        <Routes>
          <Route path="/" element={<Login />} />
          <Route path="/recover" element={<PasswordRecovery />} />
          <Route path="/signup" element={<SignUp />} />
          <Route path="/home" element={<Home />} />
          <Route path="/dashboard" element={<Dashboard />} />
          <Route path="/meetings" element={<Meetings />} />
          <Route path="/settings" element={<Settings />} />
          <Route path="/directory" element={<Directory />} />
          <Route path="/meetings/new" element={<MeetingEdit />} />
          {/* <Route path="/upload" element={<Uploads />} /> */}
        </Routes>
      </ConditionalSidebar>
    </Router>
  );
};

export default App;
